import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';


ReactDOM.render(

  <React.StrictMode>
    <Context.Provider value={{ currentPage, setCurrentPage, store }}>
      <App />
    </Context.Provider>
  </React.StrictMode>,

  document.getElementById('root')
);
